{"FieldID": 38649, "Label": "1. During the PUR, was there evidence of at least twice monthly visits between the Case Specialist and Child(ren) to assess the Safety, Permanency and Well-being of the Child and promote achievement of Case goals with at least one visit being in the Child’s Placement? (5.1.a MSA)", "SystemName": "TWICEMONTLYVISITS"},
{"FieldID": 38650, "Label": "Does the Child Meet the Definition of Special Needs?", "SystemName": "SPECIALNEEDS"},
{"FieldID": 38651, "Label": "2. For Children with Special Needs, did the Reviewer find that the Child was matched with a placement resource that meets their special therapeutic and medical needs? (MSA 4.2, 4.14)", "SystemName": "MSA42"},
{"FieldID": 38652, "Label": "3. Did the Reviewer find that the Placement for the Child is the least restrictive? (MSA 4.3)", "SystemName": "MSA43"},
{"FieldID": 38653, "Label": "3b. Explanation why the Placement is not the least restrictive:", "SystemName": "PLEASEEXPLAINMSA43"},
{"FieldID": 38654, "Label": "4. MSA 4.7 abcde", "SystemName": "MSA47ABCDE"},
{"FieldID": 38656, "Label": "5d. MSA 8.1.g Question", "SystemName": "MSA81G"},
{"FieldID": 38657, "Label": "1099 Eligible Service", "SystemName": "1099ELIGIBLESERVICE"},
{"FieldID": 38658, "Label": "6. Did the Reviewer find evidence that a visitation plan was developed and regularly updated in the FSP in collaboration with the Parents, Foster Parents, and the Child (as age appropriate)? (MSA 5.2.b)", "SystemName": "MSA52B"},
{"FieldID": 38659, "Label": "6a. If Parental visitation is appropriate, does the visitation plan include a minimum of two visits per month with the Parents, unless the court order in the Child’s case limits such visits or unless it is documented that a parent failed to make himself or herself available. (MSA 5.2.b.1)", "SystemName": "MSA52B1"},
{"FieldID": 38660, "Label": "IV-E Ineligible Reason(s)", "SystemName": "INELIGIBLEREASONS"},
{"FieldID": 38661, "Label": "6b. If Parental visitation was appropriate, did the Reviewer find a minimum of two visits per month between the Child and Parent during the PUR? (MSA 5.2.b.1.a)", "SystemName": "MSA52B1A"},
{"FieldID": 38662, "Label": "7a. If siblings are separated and no exceptions to sibling visits exist, did the Reviewer find monthly visits were provided between the siblings not in the same placement, during the PUR? (MSA 5.2.b.2.a)", "SystemName": "MSA52B2A"},
{"FieldID": 38664, "Label": "7c. If siblings are separated during the PUR and there was an identified exception to maintain visitation, what was the MSA exception that applied? (MSA 5.2.b.4.a.c)", "SystemName": "MSA52B4AC"},
{"FieldID": 38665, "Label": "Grievance Portal User ID", "SystemName": "GRIEVANCEPORTALUSERIDENTIFIER"},
{"FieldID": 38666, "Label": "9. If the Child has a Court Ordered Permanency goal of Guardianship/Durable Legal Custody in effect at the time of Review, was there documentation that the plan was appropriate to the Child’s need for Permanency and to the circumstances of the Case?  (MSA 6.3.d.1)", "SystemName": "MSA63D1"},
{"FieldID": 38667, "Label": "9a. If the Child has a Court Ordered Permanency Goal of APPLA in effect at the time of Review, was the plan appropriate to the Child’s need for Permanency and to the circumstances of the Case? (MSA 6.3.e)", "SystemName": "MSA63E"},
{"FieldID": 38668, "Label": "11. During the PUR, did the Reviewer find the agency adequately assessed the needs of the resource Parent monthly (with respect to services they need in order to provide appropriate care and supervision to ensure the safety and well-being of the Children in their care) (MSA 5.1.d)", "SystemName": "MSA51D"},
{"FieldID": 38669, "Label": "12. During the period under review, if the whereabouts of one or both Parents are unknown, did the Reviewer find that the Agency instituted a diligent search within 30 days of the time the whereabouts became unknown to the Agency and document in the case record? (MSA 6.1.c) Select all that apply:", "SystemName": "MSA61C"},
{"FieldID": 38670, "Label": "13. During the PUR, did the Reviewer find at least monthly contacts between the Caseworker and the Parent(s), with whom the Child is to be reunified, to assess service delivery and promote achievement of case goals, discuss progress on Family Service Plan, to keep the Family informed and involved in decisions about the Child, Child’s well-being, and remain current on the Family’s circumstances? (MSA 5.1.c.6.3.a.2)", "SystemName": "MSA51C63A2"},
{"FieldID": 38671, "Label": "13a. During the PUR, did the Reviewer find that MDCPS identified in the FSP and made available, directly or through referrals, services deemed necessary to address behaviors and conditions that resulted in the Child’s placement into Foster Care and help the Parent(s) develop strategies to achieve permanency for the Child? (MSA  6.3.a.1.b)", "SystemName": "MSA63A1B"},
{"FieldID": 38672, "Label": "13b. During the PUR, did the Reviewer find that the case record documented opportunities provided to the Parents to support the plan of reunification? (MSA 6.3.a.3)", "SystemName": "MSA63A3"},
{"FieldID": 38675, "Label": "15. If this is the first review of the Case for the Child and the Permanent Plan is Reunification, Did the Reviewer find evidence of Agency efforts to begin engagement in concurrent planning during the PUR? (MSA 6.2.a)", "SystemName": "MSA62A"},
{"FieldID": 38676, "Label": "16. Did the Reviewer find evidence that the agency arranged contact for the Child with his/her Parents and with any siblings not in the same placement within 72 hours of the Foster Care Placement unless there was documented reason why contact should not occur or if a visit could not be arranged that a telephone call to the Parents, siblings, or extended family member was provided? (MSA 5.2.a)", "SystemName": "MSA52A"},
{"FieldID": 38677, "Label": "17. Did the Reviewer find evidence that the initial FSP was developed within 45 days; with consultation with the applicable Child, Parents, and Resource Parents to identify strengths and appropriate services? (MSA 6.1.a) Select all that apply:", "SystemName": "MSA61A"},
