{"FieldID": 39099, "Label": "Summary of Section 4: Personnel Functions and Qualifications Policy and Practices Reviews", "SystemName": "SUMMARY04_X_1"},
{"FieldID": 39100, "Label": "Record Keeping", "SystemName": "SECTION05"},
{"FieldID": 39101, "Label": "Section Overview: Recordkeeping", "SystemName": "HEADER05_0"},
{"FieldID": 39102, "Label": "Rule 5.1 Records Maintenance", "SystemName": "HEADER05_01"},
{"FieldID": 39103, "Label": "The provider must maintain records to document services provided and administrative and fiscal accountability. MDCPS must have access to all records and reports: 5.1.A", "SystemName": "RULE05_01_A"},
{"FieldID": 39104, "Label": "In the event of the closing of the provider, the provider must develop a plan for the longterm storage of children?s records.: 5.1.B", "SystemName": "RULE05_01_B"},
{"FieldID": 39105, "Label": "The closed records must be kept up to a minimum of seven (7) years upon closing of the case: 5.1.B.1", "SystemName": "RULE05_01_B_01"},
{"FieldID": 39106, "Label": "Adoption files must be kept permanently: 5.1.B.2", "SystemName": "RULE05_01_B_02"},
{"FieldID": 39107, "Label": "All records must be confidential and protected from fire, damage or theft: 5.1.C", "SystemName": "RULE05_01_C"},
{"FieldID": 39108, "Label": "Release of records without the approval of the court or MDCPS may be found guilty of a misdemeanor and subject to a fine of no more than one thousand dollars ($1,000) or six (6) months imprisonment: 5.1.D", "SystemName": "RULE05_01_D"},
{"FieldID": 39109, "Label": "Summary of Rule 5.1: Records Maintenance", "SystemName": "SUMMARY05_01_X"},
