{"FieldID": 39114, "Label": "The following records must be kept three (3) years: Personnel Records and training records: 5.2.B.1", "SystemName": "RULE05_02_B_01"},
{"FieldID": 39115, "Label": "The following records must be kept three (3) years: All information should be current within 30 days: 5.2.B.2", "SystemName": "RULE05_02_B_02"},
{"FieldID": 39116, "Label": "The following records must be kept three (3) years: Employee Work Schedule Log: 5.2.B.3", "SystemName": "RULE05_02_B_03"},
{"FieldID": 39117, "Label": "The following records must be kept three (3) years: Must be a sign-in and sign-out log or swipe record: 5.2.B.4", "SystemName": "RULE05_02_B_04"},
