{"FieldID": 39163, "Label": "Resource Family home records must contain: Completed home study: 5.5.A.2", "SystemName": "RULE05_05_A_02"},
{"FieldID": 39164, "Label": "Resource Family home records must contain: Current medical reports/results: 5.5.A.3", "SystemName": "RULE05_05_A_03"},
