{"FieldID": 39181, "Label": "Resource Family home records must contain:  Current vaccination records on all domestic household pets and outdoor animals on the premises that are accessible to the foster children: 5.5.A.19", "SystemName": "RULE05_05_A_19"},
{"FieldID": 39182, "Label": "Resource Family home records must contain:  Any pets that do not receive vaccinations must be caged and not exposed to children placed in the home: 5.5.A.20", "SystemName": "RULE05_05_A_20"},
{"FieldID": 39183, "Label": "The following information regarding ALL Resource Homes must be sent to Licensure Unit within ten (10) calendar days after a home is licensed and as information is updated: Face sheet: 5.5.B.1", "SystemName": "RULE05_05_B_01"},
{"FieldID": 39184, "Label": "Rule 5.5.B.2 The following information regarding ALL Resource Homes must be sent to Licensure Unit within ten (10) calendar days after a home is licensed and as information is updated: All parent licenses and certifications, Background checks, criminal record, central registry check, sexual offender registry including fingerprints on all household members aged 14 years and older. 5.5.B.2", "SystemName": "RULE05_05_B_02"},
{"FieldID": 39185, "Label": "The following information regarding ALL Resource Homes must be sent to Licensure Unit within ten (10) calendar days after a home is licensed and as information is updated: Signed copy of grievance/discipline policy: 5.5.B.3", "SystemName": "RULE05_05_B_03"},
