{"FieldID": 39188, "Label": "The following information regarding ALL Resource Homes must be sent to Licensure Unit within ten (10) calendar days after a home is licensed and as information is updated: Detailed pictures of each room in home: 5.5.B.6", "SystemName": "RULE05_05_B_06"},
{"FieldID": 39189, "Label": "The following information regarding ALL Resource Homes must be sent to Licensure Unit within ten (10) calendar days after a home is licensed and as information is updated: Detailed pictures of the exterior of home and surroundings: 5.5.B.7", "SystemName": "RULE05_05_B_07"},
